import React from 'react'

export default class AuthManager extends React.Component{
	constructor(props) {
		super(props);
		this.token = null;
	}
	
	signIn() {
		console.log("Signing in!")
		// this.token = 'fake-token';
	}

	signOut() {
		console.log("Signing out...")
		this.token = null;
	}

	isAuthenticated() {
		return this.token != null ? true : false;
	}

	render() {
		return null
	}

}
